import "antd/dist/antd.css";
import { Layout } from 'antd';
const { Header, Footer, Sider, Content } = Layout;





const Greeting = () => {


    return (<div>
        <center>
            <Layout>

                <Content>
                    <h1>  Sin In</h1>
                </Content>
                <Content>
                    <from>
                        Name   <input type="text" />
                    </from>

                </Content>

            </Layout>
        </center>
    </div >
    )
}
export default Greeting;
